import { observable } from 'mobx'
import { observer, inject } from 'mobx-react'

@observer
class ProductsStore {
    @observable all = [];
    @observable foo = 'bar';

    constructor (rootStore) {
        this.rootStore = this.rootStore
    }
}

export default ProductsStore;
